import { QuestionNavbar } from "../QuestionNavbar.js";
import { Info } from "./components/Info.js";

export const Info9 = () => {
  return (
    <div className="infos">
      <QuestionNavbar />
      <Info
        title={[
          "Viranomaisten auktorisoimat tutkimuslaitokset ja instituutiot ovat monesti ensisijaisia lähteitä. Usein media suosii vakiintuneita asiantuntijalähteitä ja viranomaislausuntoja. ​",
          "Voisiko lähdevalikoimaa laajentaa lähdekritiikkiä unohtamatta? Olisiko mahdollista monipuolistaa näkökulmia vähemmän tunnettuja asiantuntijoita haastattelemalla? Mitä lähdekritiikki merkitsee viranomaistiedon ja auktorisoitujen lähteiden tapauksessa? Ovatko asiantuntijat yksimielisiä vai onko aiheesta erilaisia näkemyksiä, joita pitäisi kuunnella? ​​​",
        ]}
        options={[
          {
            value:
              "Reunanen, E. (2022)​",
            navigate: "https://trepo.tuni.fi/handle/10024/144761",
          },
          {
            value:
              "Kunelius, Noppari, Reunanen (2010)",
            navigate: "https://trepo.tuni.fi/handle/10024/65414",
          },
          {
            value:
              "Meneillään oleva DECA-hanke tutkii yhteiskunnan tiedollisia järjestelmiä, käytänteitä ja ongelmia useista näkökulmista, tutustu",
            navigate: "https://www.decatutkimus.fi/",
          },
        ]}
        next={"study/11"}
      />
    </div>
  );
};
